import React from 'react';
// import './Components/navbar.css'; 
import './Navbar.css';
import Logo from '../Assets/logo.png'



const Navbar = () => {
    return (
        <nav>
            <div className="logo">
                {/* <p>Rare Fairy</p> */}
                <img src={Logo} alt="" />
            </div>
            <ul>
                <li><a href="#">Home</a></li>
                <li><a href="#">About Us</a></li>
                <li><a href="#">Contact Us</a></li>
                <li><a href="#">Ari designs</a></li>
                <li><a href="#">Login</a></li>
            </ul>
        </nav>
    );
}

export default Navbar;
